import React, {useEffect} from "react";
import {useDispatch, useSelector} from 'react-redux';
import { loadDropboxData } from "./actions";

function App() {
  const dispatch = useDispatch();
  const imageArray = useSelector(state => state.dropbox.dropboxImageArray)

  useEffect(() => {
    dispatch(loadDropboxData())
  }, [])

  return (
    <>
      {imageArray.map((imageObj, index)=>{
        let thumbnail
        return (<>
        <div>1-{imageObj.name}</div>
        <img key={index} src={imageObj.path_display} alt="" />
        </>)
      })}
    </>
  )
}

export default App
